import React from "react";
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";
import Notes from "..notes";
function App() {
  return (
    <div>
      <Header />
      <Note title="This is the note title" content="This is the note content" />
      <Footer />
    </div>
  );
}

export default App;
